import { container, title } from "assets/jss/material-kit-react.jsx";

const landingPageStyle = {
	container: {
		zInde: "12",
		color: "#ffffff",
		...container
	},
	title: {
		...title,
		display: "inline-block",
		position: "relative",
		marginTop: "30px",
		minHeight: "32px",
		color: "#ffffff",
		textDecoration: "none"
	},
	subtitle: {
		fontSize: "1.313rem",
		maxWidth: "500px",
		margin: "10px auto 0"
	},
	main: {
		background: "#ffffff",
		position: "relative",
		zIndex: "3"
	},
	mainRaised: {
		margin: "-60px 30px 0",
		borderRadius: "6px",
		boxShadow:
      "0 16px 24px 2px rgba(0, 0, 0, 0.14), 0 6px 30px 5px rgba(0, 0, 0, 0.12), 0 8px 10px -5px rgba(0, 0, 0, 0.2)"
	}
}

export default landingPageStyle;
